import React, { Component } from "react";

export default class Band extends Component {
  constructor() {
    super();

    this.state = {
      bandName: "Rush",

      bandMembers: [
        {
          id: 1,
          name: "Neil Peart",
          instrument: "Bateria",
        },
        {
          id: 2,
          name: "Alex Lifeson",
          instrument: "Guitarra",
        },
        {
          id: 3,
          name: "Geddy Lee",
          instrument: "Baixo",
        },
      ],
    };
  }
  render() {
    return <div>Band</div>;
  }
}
